import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { SignIn } from '../../models/signin.class';
import '../../styles/slForms.css';

const SigninComponent = () => {
    const [fullName, setFullName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [phone, setPhone] = useState('');
    const [personalID, setPersonalID] = useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
    }

    return (
        <div>
            <form className='sl-form' onSubmit={handleSubmit}>
                <label>
                    Full Name:
                    <input type="text" value={fullName} onChange={event => setFullName(event.target.value)} />
                </label>
                <br />
                <label>
                    Email:
                    <input type="email" value={email} onChange={event => setEmail(event.target.value)} />
                </label>
                <br />
                <label>
                    Password:
                    <input type="password" value={password} onChange={event => setPassword(event.target.value)} />
                </label>
                <br />
                <label>
                    Phone:
                    <input type="tel" value={phone} onChange={event => setPhone(event.target.value)} />
                </label>
                <br />
                <label>
                    Personal ID:
                    <input type="text" value={personalID} onChange={event => setPersonalID(event.target.value)} />
                </label>
                <br />
                <input type="submit" value="Submit" />
            </form>
        </div>
    );
}

SigninComponent.propTypes = {
    fullName: PropTypes.instanceOf(SignIn).isRequired,
    email: PropTypes.instanceOf(SignIn).isRequired,
    password: PropTypes.instanceOf(SignIn).isRequired,
    phone: PropTypes.instanceOf(SignIn).isRequired,
    personalID: PropTypes.instanceOf(SignIn).isRequired
};

export default SigninComponent;
